import React from 'react';
import BoxMessage from './BoxMessage';
import PatientHeatMap from './PatientHeatMap';
import {connect} from 'react-redux';
import {getPatientData as pData} from '../../store/actions/patientActions';


const Demographics = (props) => {
    return (
        <div className="container">
            <p>select options for states district and also the calander</p>

            <div>
                <BoxMessage />
            </div>

            <div className="mt-5">
                <PatientHeatMap />
            </div>

        </div>
    )
}



export default connect(null, pData())(Demographics)
